import React from "react";

const ImageView = (props) => {
  //const {largeImageURL: image, tags, user: }
  return (
    <div>
      <img
        src={props.location.state.image.largeImageURL}
        alt={props.location.state.image.id}
      />
      <p>&copy;pixabay</p>
      <h4>
        Credit: <span>{props.location.state.image.user.owner}</span>
      </h4>
    </div>
  );
};

export default ImageView;
